import react from 'react'

//import layout
import ContentFragment from '../../layouts/ContentFragment'

//import style
// import rpiStyles from './rpi.module.scss'

const ProjectRpi = (props) => {
    const project = props.data
    return (
        <react.Fragment>
            <ContentFragment title={project.title}
                time={project.time} text={project.intro}>

                {/* Photos */}
                <div className="row">
                    <div className="intro1"></div>
                    <div className="intro2"></div>
                </div>
                <div className="row">
                    <div className="intro2"></div>
                    <div className="intro1"></div>
                </div>
            </ContentFragment>

            <ContentFragment subtitle="Main Development"
                text={project.main}>

                {/* Photos */}
                <div>Photos</div>
            </ContentFragment>

            <ContentFragment subtitle="Technology"
                text={project.technology}>

                {/* Photos */}
                <div className="row">
                    <div className="main1"></div>
                    <div className="main2"></div>
                </div>
                <div className="row">
                    <div className="intro1"></div>
                    <div className="intro2"></div>
                </div>
            </ContentFragment>
            <style jsx>{`
                .intro1 {
                    margin: 0;
                    // margin-right: 20px;
                    height: 200px;
                    // width: 150px;
                    flex: 0.18;
                    border: red solid 1px;

                    //background
                    background-image: url('/static/images/projects/rpi/intro1.png');
                    background-size: cover;
                    background-position: center;
                }

                .intro2 {
                    margin: 0;
                    height: 200px;
                    // width: 580px;
                    flex: 0.80;
                    border: red solid 1px;

                    //background
                    background-image: url('/static/images/projects/rpi/intro2.png');
                    background-size: cover;
                    background-position: center;
                }

                .main1 {
                    margin: 0;
                    // margin-right: 20px;
                    height: 200px;
                    // width: 150px;
                    flex: 0.5;
                    border: red solid 1px;

                    //background
                    background-image: url('/static/images/projects/rpi/main.png');
                    background-size: cover;
                    background-position: center;
                }

                .intro2 {
                    margin: 0;
                    height: 200px;
                    // width: 580px;
                    flex: 0.24;
                    border: red solid 1px;

                    //background
                    background-image: url('/static/images/projects/rpi/main2.png');
                    background-size: cover;
                    background-position: center;
                }


            `}</style>
        </react.Fragment>
    )
}

export default ProjectRpi;
